  `phoneKey` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_bin NULL DEFAULT NULL COMMENT '手机唯一标志',
  `created` int(11) NULL DEFAULT NULL,
  `updated` int(11) NULL DEFAULT NULL COMMENT '更新时间',
  `lastSignTime` int(11) NULL DEFAULT NULL COMMENT '上一次签到时间',
  `loginTime` int(11) NULL DEFAULT NULL COMMENT '登录时间',
  `token` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT '' COMMENT '用户令牌',
