  UNIQUE INDEX `phone`(`phone`(20)) USING BTREE,
  INDEX `sex`(`sex`) USING BTREE,
  INDEX `ageType`(`ageType`) USING BTREE,
  INDEX `city_id`(`city_id`) USING BTREE,
  INDEX `longitude`(`longitude`) USING BTREE,
  INDEX `latitude`(`latitude`) USING BTREE,
  INDEX `userId`(`userId`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 103284 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_bin ROW_FORMAT = Dynamic;

